// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import PaymentPage from './PaymentPage';

const App = () => {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/payment" component={PaymentPage} />
          {/* Add more routes here as needed */}
        </Switch>
      </div>
    </Router>
  );
};

export default App;
